import React from "react";
let uuid = "5f8d3a7f-467b-97f3-062c-13acf203c006";
const url = 'https://valorant-api.com/v1/';
let search ="agents";
let happened = false;
let happened2 = false;

function Agents() {
    fullData();
    //find();


    return <div id="Agents">
        <img src={"https://media.valorant-api.com/playercards/9fb348bc-41a0-91ad-8a3e-818035c4e561/largeart.png"} className="App-logo" alt="logo" id="b"/>
        <h2 id={"a"}></h2>

        <select id="select">

        </select>
        <button id="button" onClick={change}>Change</button>
    </div>

}

async function fullData() {
    const response = await fetch(url + search + "?isPlayableCharacter=true");
    const data = await response.json();
    if (!happened){

        let df = document.createDocumentFragment();
        for (let i = 0; i < data.data.length; i++){
            let option = document.createElement("option");
            option.value = data.data[i].uuid;
            option.appendChild(document.createTextNode(data.data[i].displayName));
            df.appendChild(option);
        }
        document.getElementById("select").appendChild(df);
        happened = true;
    }

    else {
        happened = false;
    }


    //console.log()
    //console.log(data.data[0].displayName)
}

async function find() {

    if (!happened2){
        const response = await fetch(url +search + "/"+ uuid);
        const data = await response.json();
        console.log("Vastaus apilta");
        console.log(data.data.displayName);


        document.getElementById('a').textContent =data.data.displayName ;
        document.getElementById('b').src=data.data.largeArt;
        happened2 = true;
    }

    else {
        happened2 = false
    }



}

function change(){
    uuid = (document.getElementById("select").value);
    find();
}

export default Agents;
